(179, 14, 'project_introductory_paragraph', 'NAIL - an advertising agency in Downtown Providence, was renovating their conference room, and wanted to improve acoustic qualities of the space. Thurlow Small Architects proposed an acoustical wall panel system, and contacted us to fabricate and install the panels. Through exhaustive prototyping, we arrived at a visually delightful, affordable, and easily producable design that brings a sense of drama and excitement to the new conference room. Over at NAIL, they call the panels their “home field advantage”.'),
