(492, 41, 'project_introductory_paragraph', 'Digital City is an organization promoting digital media production in Rhode Island; their goal is to make the state a hub for digital media by 2020. The approached us with several different needs — they planned on opening a co-working space for digital media professionals, wanted to launch a website for their organization, and needed a cohesive identity to tie their vision to. We offered to roll all three of those processes into one. We integrated the architecture of the co-working space, the design of the website, and the strategy of brand into one synchronized process – and then built it, all in one go.'),
