(625, 59, 'project_introductory_paragraph', 'As part of I-195 redevelopment commission’s initiative to bring more public art into Providence’s Jewelery district, our client, Aarti Kathuria, designed an piece of installation art. Aarti approached us to design a fabrication system, and coordinate the construction of her installation concept. Together, we conducted feasibility studies, came up with a material system, built, and installed her piece. The result is a visually striking object that frames views of the Providence skyline.'),
