(706, 76, 'project_introductory_paragraph', 'As part of a renovation and update of their office space, RISD Media approached us to design  and fabricate a large production surface. Their goals were clear: They wanted a workspace to fulfill the technical needs of their graphic designers, and to house two new flat files for print storage. They also wanted a space to hold a meeting with their entire staff of 14 people. We took it as an opportunity to create a great working experience for the office and prove our contention that there really is no such thing as table that’s too big.'),
