(919, 89, 'project_introductory_paragraph', 'Operating out of a co-working space like the Design Office is a wonderful and democratic proposition. As a group, we came together and identified a need for a private, closed-off space for the membership to take their phone calls and video meetings. Our studio researched potential solutions to this need, went through phases of architectural design, and ultimately fabricated the “Phone Booth” – a functional intervention that gives the membership a place to communicate – or just have a moment to relax. '),
