(1003, 94, 'project_what_we_did', 'We devised a fabrication strategy for the production of batches of unique, yet continuous pen blocks.'),
(1004, 94, '_project_what_we_did', 'field_54b7d8f306267'),
(1005, 94, 'project_introductory_paragraph', 'We wanted to apply processes we hold dear — computation, digital fabrication, and traditional woodwork — to a  lighthearted object. The result is a neighborhood of penholders, which, although separate, maintain conceptual and geometric continuity. We first wrote a script to generate each penscape’s form and randomize its pen-holes, after which we machined the terrain out of hardwood, and cut each block to size manually.'),
