(1043, 97, 'project_what_we_did', 'We produced a family of websites, web apps, and mobile apps to for the Smithsonian Institution and the Laboratory for Visual Learning. '),
(1044, 97, '_project_what_we_did', 'field_54b7d8f306267'),
(1045, 97, 'project_introductory_paragraph', 'These platforms helped them communicate their research, engage with users to collect data, and provide training and certification to learning disability specialists. The Read Easy website communicates graphic standards to increase readability for people with learning disabilities, as well as providing a pathway to certification through an online course. The VA Span website and mobile app tests visual memory and helps learning disability specialists gather data and produce diagnoses. The Inctech website is a contest for high school students to find ways that technology can help them overcome a difficulty they are having with school or learning. '),
(1046, 97, '_project_introductory_paragraph', 'field_5410f7e64e6b2'),
