(1068, 97, 'project_stories_0_project_story_content', '<div class="row m90">\r\n<div class="col-sm-3 col-sm-offset-1">\r\n<img src="http://localhost/ws/wp-content/uploads/2015/01/readeasylogo.png" alt="readeasylogo" width="382" height="200" class="alignnone size-full wp-image-556" />\r\n</div>\r\n<div class="col-sm-4 col-sm-offset-1">\r\n<h3>\r\nThe Read Easy website combines interactive presentation tools, a catalog of research, and an online course for educators to gain certification in these topics. \r\n</h3>\r\n</div>\r\n</div>\r\n<div class="row m90">\r\n<div class="col-sm-5 col-sm-offset-1">\r\n<img src="http://localhost/ws/wp-content/uploads/2015/01/readeasyhome-704x1024.png" alt="readeasyhome" width="704" height="1024" class="alignnone size-large wp-image-555" />\r\n</div>\r\n<div class="col-sm-5 col-sm-offset-1">\r\n<img src="http://localhost/ws/wp-content/uploads/2015/01/readeasycourse.png" alt="readeasycourse" width="1681" height="4407" class="alignnone size-full wp-image-554" />\r\n</div>\r\n</div>\r\n<div class="row m90">\r\n<div class="col-sm-3 col-sm-offset-2">\r\n<img src="http://localhost/ws/wp-content/uploads/2015/01/iphone11-508x1024.jpg" alt="iphone1" width="508" height="1024" class="alignnone size-large wp-image-558" />\r\n</div>\r\n<div class="col-sm-3">\r\n<img src="http://localhost/ws/wp-content/uploads/2015/01/iphone21-508x1024.jpg" alt="iphone2" width="508" height="1024" class="alignnone size-large wp-image-559" />\r\n</div>\r\n<div class="col-sm-3">\r\n<img src="http://localhost/ws/wp-content/uploads/2015/01/iphone61-508x1024.jpg" alt="iphone6" width="508" height="1024" class="alignnone size-large wp-image-563" />\r\n</div>\r\n\r\n</div>\r\n<div class="row">\r\n<div class="col-sm-4 col-md-3 col-sm-offset-1">\r\n<video class="padded" autoplay="autoplay" loop="" poster="http://localhost/ws/wp-content/uploads/2015/01/devices-sm-1440x878.jpg">\r\n<source src="http://localhost/ws/wp-content/uploads/2015/01/iphone-videod-croppeda.mp4" type="video/mp4" />\r\n<source src="http://localhost/ws/wp-content/uploads/2015/01/iphone-videod-croppeda.webm" type="video/webm" />\r\n</video>\r\n</div>\r\n<div class="col-sm-offset-1 col-sm-5">\r\n<p class="m2 h4 text">\r\nThe Read Easy website allows its visitors to learn about screen-legibility through interactive play. Creating a reactive feedback mechanism that displays various textual properties in an intuitive way was a lot of fun.\r\n</p>\r\n</div>\r\n</div>'),
(1069, 97, '_project_stories_0_project_story_content', 'field_5410f92b61c07'),
