(1109, 101, 'project_what_we_did', 'We collaborated with The Design Office to create a dynamic exhibition guide, built around a receipt printer. '),
(1110, 101, '_project_what_we_did', 'field_54b7d8f306267'),
(1111, 101, 'project_introductory_paragraph', 'In the summer of 2013, the membership of the Design Office came together to design, program, engineer, and fabricate “Locally Made”, an exhibition at the RISD Museum that celebrated Rhode Island artists and designers. The centerpiece of the exhibition design was a thermal printer that printed a programmatically generated daily guide to the museum when prompted. We designed and fabricated the enclosure for the printer.'),
