(1147, 104, 'project_what_we_did', 'We re-imagined HB Design & Build’s portfolio website - emphasizing their process, and the stories their work tells. '),
(1148, 104, '_project_what_we_did', 'field_54b7d8f306267'),
(1149, 104, 'project_introductory_paragraph', 'HB Design & Build base their practice on working as both architects and builders. We wanted to build them a website which provides viewers with an access point to that sensibility, showcasing their craft, their projects, and their principles. The result is a pared-down interface, that presents the viewer with a few different viewing options without getting in the way of their rich content.'),
