(1193, 106, 'project_what_we_did', 'We worked with the Creative Mind Initiative to build a web-based window into the classroom, studio, and laboratory at Brown University.'),
(1194, 106, '_project_what_we_did', 'field_54b7d8f306267'),
(1195, 106, 'project_introductory_paragraph', 'The Creative Arts Council at Brown approached us with an idea for a new initiative within the university. The Creative Mind Initiative is one part creativity research project, on part documentation effort. They wanted a web presence that reinforced their brand, while providing viewers with access to many projects, courses, interviews, and events that they document at Brown. We built them a website to act as an archive and showcase of their efforts, both within the Brown community and beyond.'),
