(2076, 104, 'project_stories_1_project_story_content', '<div class="row m60">\r\n<div class="col-sm-9">\r\n<img src="http://localhost/ws/wp-content/uploads/2015/01/hb-web-grid-1024x581.png" alt="hb web grid" width="1024" height="581" class="alignnone size-large wp-image-257 shadow" />\r\n</div>\r\n\r\n<div class="col-sm-3">\r\n<p class="h3 text underline">HB sorts their work into Projects and Collaborations.</p>\r\n</div>\r\n</div>\r\n\r\n<div class="row m1">\r\n<div class="col-sm-3">\r\n<p class="h3 text underline">They keep their friends, clients, and followers updated via their Instagram. We embedded their feed on the website. </p>\r\n</div>\r\n\r\n<div class="col-sm-9">\r\n<img src="http://localhost/ws/wp-content/uploads/2015/01/hb-web-current-1024x581.png" alt="hb-web-current" width="1024" height="581" class="alignnone size-large wp-image-281 shadow" />\r\n</div>\r\n</div>'),
