(2138, 30, 'project_stories_0_project_story_content', '<div class="row m30">\r\n<div class="col-sm-6">\r\n<img src="http://localhost/ws/wp-content/uploads/2015/01/IMG_1384-1024x683.jpg" alt="IMG_1384" width="1024" height="683" class="alignnone size-large wp-image-286 shadow" />\r\n<p class="text small italic">1. Design Office Desk System.</p>\r\n</div>\r\n<div class="col-sm-6">\r\n<img src="http://localhost/ws/wp-content/uploads/2015/01/do9-1024x683.jpg" alt="do9" width="1024" height="683" class="alignnone size-large wp-image-304 shadow" />\r\n<p class="text small italic">2. Library Shelving.</p>\r\n</div>\r\n</div>\r\n\r\n<div class="row">\r\n<div class="col-sm-6">\r\n<h2>\r\nWe considered the Design Office\'s interiors holistically. The 12 desks, wall shelving, and a large meeting tables have interlocking and complimentary functions in the space. A uniform palette of maple plywood ties the furniture suite together aesthetically.\r\n</h2>\r\n</div>\r\n<div class="col-sm-6">\r\n<img src="http://localhost/ws/wp-content/uploads/2015/01/IMG_2422-1024x683.jpg" alt="IMG_2422" width="1024" height="683" class="alignnone size-large wp-image-301" />\r\n<p class="text small italic">3. Large Meeting Table.</p>\r\n</div>\r\n</div>'),
