(2153, 41, 'project_stories_0_project_story_content', ' <div class="row m90">\r\n<div class="col-sm-10 col-sm-offset-1">\r\n\r\n<img src="http://localhost/ws/wp-content/uploads/2015/01/integrated.jpg" alt="integrated" width="1680" height="1078" class="alignnone size-full wp-image-291" />\r\n\r\n</div>\r\n</div>\r\n\r\n<div class="row">\r\n<div class="col-md-8 col-md-offset-2 col-sm-10 col-sm-offset-1">\r\n\r\n<h2 class="centered">Digital City was an exciting opportunity to merge physical, visual, and digital designs into one cohesive result. We provided branding, web design and development, interior architectural design, and construction services. </h2>\r\n</div>\r\n</div>\r\n\r\n'),
