(2166, 30, 'project_stories_1_project_story_content', '<div class="row m60">\r\n<div class="col-sm-offset-2 col-sm-8">\r\n<h3 class="centered">We built 12 desks, arranged into 4 modules. These modules provide an alternative to the typical cubicle setup. They provide an clear field of view, and visual privacy, while maintaining a communal and collaborative office atmosphere.</h3>\r\n</div>\r\n</div>\r\n\r\n<div class="row m2">\r\n<div class="col-sm-6">\r\n<img src="http://localhost/ws/wp-content/uploads/2015/01/IMG_1318-1024x682.jpg" alt="IMG_1318" width="1024" height="682" class="alignnone size-large wp-image-36 shadow" />\r\n</div>\r\n\r\n<div class="col-sm-3">\r\n<img src="http://localhost/ws/wp-content/uploads/2015/01/IMG_1308-1024x682.jpg" alt="IMG_1308" width="1024" height="682" class="alignnone size-large wp-image-35 shadow" />\r\n<p class="text italic h6">An appropriately-sized opening.</p>\r\n</div>\r\n\r\n<div class="col-sm-3">\r\n<img src="http://localhost/ws/wp-content/uploads/2015/01/IMG_1260-1024x682.jpg" alt="IMG_1260" width="1024" height="682" class="alignnone size-large wp-image-33 shadow" />\r\n<p class="text italic h6">Off-the-shelf legs compliment the otherwise custom fabrication.</p>\r\n</div>\r\n\r\n</div>\r\n<div class="row">\r\n<div class="col-sm-4 col-sm-offset-">\r\n<h3 class="text mt">We wanted the desk\'s joinery and craft to be expressive. The desk\'s scarf joint acts as a visual anchor for the desk and a graphic expression of the structure.</h3>\r\n</div>\r\n\r\n<div class="col-sm-8">\r\n<img src="http://localhost/ws/wp-content/uploads/2015/01/IMG_1305-1024x683.jpg" alt="IMG_1305" width="1024" height="683" class="alignnone size-large wp-image-292 shadow" />\r\n</div>\r\n\r\n</div>'),
