(2180, 41, 'project_stories_1_project_story_content', '<div class="row m90">\r\n<div class="col-sm-4">\r\n<h3 class="bold uppercase">Identity Design</h3>\r\n<h3 class="text">We built Digital City\'s brand around the visual motif of \'bits\'. Bit\'s can be composed, or move freely through space, or an interface. We used the bits to string together the brand, the website, the space, and the furniture.</h3>\r\n</div>\r\n<div class="col-sm-8">\r\n<img class="alignnone size-full wp-image-306" src="http://localhost/ws/wp-content/uploads/2015/01/bits1a.png" alt="bits1a" width="1882" height="1144" />\r\n</div>\r\n</div>\r\n\r\n<div class="row m90">\r\n<div class="col-sm-3 col-sm-offset-2 col-xs-6">\r\n<img class="alignnone size-large wp-image-299 m60" src="http://localhost/ws/wp-content/uploads/2015/01/DC-Logo-color-PRIMARY-1024x348.png" alt="DC-Logo-color-PRIMARY" width="1024" height="348" />\r\n</div>\r\n\r\n<div class="col-sm-4 col-sm-offset-1 col-xs-6">\r\n<img class="alignnone size-large wp-image-420" src="http://localhost/ws/wp-content/uploads/2014/09/DC206-color-Primary1-1024x276.png" alt="DC206-color-Primary" width="1024" height="276" />\r\n</div>\r\n</div>\r\n\r\n\r\n<div class="row m90">\r\n<div class="col-sm-3 col-sm-offset-1 hidden-xs">\r\n<img src="http://localhost/ws/wp-content/uploads/2014/09/proposal_Page_1-791x1024.jpg" alt="proposal_Page_1" width="791" height="1024" class="alignnone size-large wp-image-415 shadow" />\r\n</div>\r\n<div class="col-sm-4 col-xs-6">\r\n<img src="http://localhost/ws/wp-content/uploads/2014/09/proposal_Page_5.jpg" alt="proposal_Page_5" width="1280" height="1656" class="alignnone size-full wp-image-416 shadow" />\r\n</div>\r\n<div class="col-sm-3 col-xs-6">\r\n<img src="http://localhost/ws/wp-content/uploads/2014/09/proposal_Page_7-791x1024.jpg" alt="proposal_Page_7" width="791" height="1024" class="alignnone size-large wp-image-417 shadow" />\r\n</div>\r\n\r\n</div>\r\n\r\n\r\n\r\n\r\n<div class="row m90">\r\n<div class="col-sm-8 col-sm-offset-2 ">\r\n<img src="http://localhost/ws/wp-content/uploads/2014/09/shirts.png" alt="shirts" width="1440" height="567" class="alignnone size-full wp-image-414" />\r\n</div>\r\n</div>\r\n\r\n<div class="row m90">\r\n\r\n<div class="col-sm-3 col-xs-10">\r\n<img src="http://localhost/ws/wp-content/uploads/2014/09/3bits.png" alt="3bits" width="480" height="220" class="alignnone size-full wp-image-433" />\r\n<br/>\r\n<h3 class="italic">The \'bit\'s exist in Digital City\'s Visual Identity - and also show up on the website, in physical space, and in the furniture.</h3>\r\n</div>\r\n\r\n<div class="col-sm-2 col-sm-offset-1 col-xs-6">\r\n<img src="http://localhost/ws/wp-content/uploads/2014/09/iphone-dc-bits-488x1024.png" alt="iphone-dc-bits" width="488" height="1024" class="alignnone size-large wp-image-432" />\r\n</div>\r\n\r\n<div class="col-sm-5 col-xs-6">\r\n<img class="alignnone size-large wp-image-298" src="http://localhost/ws/wp-content/uploads/2015/01/desk-opening-1024x680.jpg" alt="desk-opening" width="1024" height="680" />\r\n<p class="italic">The bits appear on the furniture in the joinery, and cable openings.</p>\r\n</div>\r\n\r\n</div>'),
