(2196, 41, 'project_stories_2_project_story_content', '<div class="row m90">\r\n<div class="col-sm-4">\r\n<h3 class="bold uppercase mt">Web Design and Development</h3>\r\n<h3 class="text">We created a simple platform to showcase Digital City\'s three core initiatives - an Educational Analysis, Co-Working Space, and Membership program.</h3>\r\n</div>\r\n<div class="col-sm-7 col-sm-offset-0">\r\n<img src="http://localhost/ws/wp-content/uploads/2014/09/dcwebmain-1024x825.png" alt="dcwebmain" width="1024" height="825" class="alignnone size-large wp-image-426" />\r\n</div>\r\n</div>\r\n\r\n<div class="row m90">\r\n<div class="col-sm-5 col-sm-offset-1 col-xs-6">\r\n<img src="http://localhost/ws/wp-content/uploads/2014/09/home.jpg" alt="home" width="1440" height="3958" class="alignnone size-full wp-image-424 shadow" />\r\n</div>\r\n<div class="col-sm-5 col-xs-6">\r\n<img src="http://localhost/ws/wp-content/uploads/2014/09/dc206.jpg" alt="dc206" width="1440" height="7153" class="alignnone size-full wp-image-422 shadow" />\r\n</div>\r\n</div>\r\n\r\n\r\n\r\n<div class="row m90">\r\n<div class="col-sm-8 col-sm-offset-2">\r\n<video autoplay loop>\r\n<source src="http://localhost/ws/wp-content/uploads/2014/09/digital-city-initial-small.mp4" type="video/mp4"/>\r\n<source src="http://localhost/ws/wp-content/uploads/2014/09/digital-city-initial-small.webm" type="video/webm"/>\r\n</video>\r\n</div>\r\n\r\n</div>'),
