(2208, 41, 'project_stories_3_project_story_content', '<div class="row m90">\r\n<div class="col-sm-4">\r\n<h3 class="bold uppercase mt">Interior Design & Build</h3>\r\n<h3 class="text">We designed, fabricated, and installed an affordable furniture and architectural system. </h3>\r\n</div>\r\n<div class="col-sm-8 col-xs-9">\r\n<img src="http://localhost/ws/wp-content/uploads/2014/09/floor-plan-for-website2.svg" alt="floor plan for website2" width="1" height="1" class="alignnone size-large wp-image-431" />\r\n</div>\r\n</div>\r\n\r\n<div class="row m90">\r\n<div class="col-sm-offset-1 col-sm-10 col-xs-12">\r\n<img src="http://localhost/ws/wp-content/uploads/2015/01/DSC_7991_edit_1-1024x680.jpg" alt="DSC_7991_edit_1" width="1024" height="680" class="alignnone size-large wp-image-46" />\r\n</div>\r\n</div>\r\n\r\n<div class="row">\r\n<div class="col-sm-10 col-xs-6 m90">\r\n<img src="http://localhost/ws/wp-content/uploads/2014/09/space-intro.jpg" alt="space-intro" width="1280" height="850" class="alignnone size-full wp-image-427" />\r\n</div>\r\n<div class="col-sm-offset-1 col-sm-10 col-xs-6">\r\n<img src="http://localhost/ws/wp-content/uploads/2015/01/DSC_8005_edit_11-1024x680.jpg" alt="DSC_8005_edit_1" width="1024" height="680" class="alignnone size-large wp-image-48" />\r\n</div>\r\n</div>\r\n\r\n<div class="row m90">\r\n<div class="col-sm-10 col-xs-6 m90">\r\n<img src="http://localhost/ws/wp-content/uploads/2015/01/DSC_7979_edit_1-1024x680.jpg" alt="DSC_7979_edit_1" width="1024" height="680" class="alignnone size-large wp-image-44" />\r\n</div>\r\n\r\n<div class="col-sm-12 col-xs-6">\r\n<img src="http://localhost/ws/wp-content/uploads/2015/01/DSC_7961_edit_1-1024x680.jpg" alt="DSC_7961_edit_1" width="1024" height="680" class="alignnone size-large wp-image-43" />\r\n</div>\r\n</div>\r\n\r\n<div class="row m90">\r\n<div class="col-sm-6 col-xs-6">\r\n<img src="http://localhost/ws/wp-content/uploads/2014/09/desk-1024x680.jpg" alt="desk" width="1024" height="680" class="alignnone size-large wp-image-428" />\r\n\r\n</div>\r\n\r\n<div class="col-sm-6 col-xs-6">\r\n<img src="http://localhost/ws/wp-content/uploads/2015/01/desk-opening-1024x680.jpg" alt="desk-opening" width="1024" height="680" class="alignnone size-large wp-image-298" />\r\n</div>\r\n</div>'),
