(2705, 533, 'project_what_we_did', 'We built an e-commerce platform and dress rental scheduling system for Couture Collective, a New York based dress sharing organization.'),
(2706, 533, '_project_what_we_did', 'field_54b7d8f306267'),
(2707, 533, 'project_introductory_paragraph', 'In collaboration with Sarah Rainwater Design, we planned and executed the development of a complex e-commerce and scheduling solution for Couture Collective\'s new online business. Before coming to us, they had been taking orders and managing dress rentals manually, as well as manually processing credit card transaction. We gathered business requirements, constructed programmatic logic to enforce these requirements, and implemented an e-commerce and calendar system – taking their manual approach and transforming it into an fully automated, web-based system.'),
