(2719, 533, 'project_stories_0_project_story_content', '<div class="row m2">\r\n<div class="col-sm-10 col-sm-offset-1">\r\n<h2 class="centered">Couture Collective is a members-only couture sharing service.</h2>\r\n<h3 class="centered">The business provides members with heavily discounted haute couture by adopting a time-sharing system.</h3>\r\n</div>\r\n</div>\r\n\r\n<div class="row padded">\r\n\r\n<div class="col-sm-6">\r\n<img src="http://localhost/ws/wp-content/uploads/2015/02/coco-spreads-home-v1-1024x582.jpg" alt="coco-spreads-home-v1" width="1024" height="582" class="alignnone size-large wp-image-538 shadow" />\r\n<p class="text italic small">Visitors without accounts are greeted with <span class="bold">evocative landing page</span>.</p>\r\n</div>\r\n\r\n<div class="col-sm-6">\r\n<img src="http://localhost/ws/wp-content/uploads/2015/02/coco-spreads-lookbook-v1-1024x581.jpg" alt="coco-spreads-lookbook-v1" width="1024" height="581" class="alignnone size-large wp-image-539 shadow" />\r\n<p class="text italic small">Members arrive at the <span class="bold">Look Book</span>, where they can schedule rentals of dresses.</p>\r\n</div>\r\n\r\n</div>\r\n\r\n<hr />\r\n\r\n\r\n\r\n'),
