(2735, 533, 'project_stories_1_project_story_content', '<div class="row m3">\r\n\r\n<div class="col-sm-7">\r\n<img src="http://localhost/ws/wp-content/uploads/2015/02/coco-spreads-dress-owned-v1-1024x1024.jpg" alt="coco-spreads-dress-owned-v1" width="1024" height="1024" class="alignnone size-large wp-image-537 shadow" />\r\n<p class="small italic">Shared dresses can be reserved through their calendars.</p>\r\n</div>\r\n\r\n<div class="col-sm-5">\r\n<h3 class="m3 bold">Rent haute couture.</h3>\r\n<h3 class="text m3">Couture Collective allows users to buy <span class="italic">shares</span> in couture. Shared items can be pre-reserved up to 5 times for free, according to the item\'s calendar.</h3>\r\n<h4 class="text">The site maintains a list of past and upcoming reservations and rentals for each member\'s dresses. Reservations can be cancelled using this list.</h4>\r\n</div>\r\n\r\n</div>\r\n\r\n<div class="row m3">\r\n\r\n<div class="col-sm-offset-5 col-sm-7">\r\n<img src="http://localhost/ws/wp-content/uploads/2015/02/coco-spreads-dress-not-owned-v1-1024x973.jpg" alt="coco-spreads-dress-not-owned-v1" width="1024" height="973" class="alignnone size-large wp-image-536 shadow" />\r\n<p class="small italic">Items that a user doesn\'t have a share in can be rented for a fee.</p>\r\n</div>\r\n\r\n</div>\r\n\r\n<hr />'),
