(2757, 533, 'project_stories_2_project_story_content', '<div class="row m3">\r\n\r\n\r\n<div class="col-sm-7">\r\n<img src="http://localhost/ws/wp-content/uploads/2015/02/coco-spreads-closet-v1-763x1024.jpg" alt="coco-spreads-closet-v1" width="763" height="1024" class="alignnone size-large wp-image-535 shadow" /></div>\r\n\r\n<div class="col-sm-5">\r\n<h3 class="m3 bold">Each user has a closet of items.</h3>\r\n<h3 class="text">The closet keeps track each member\'s shared items, as well as lists any rentals they\'ve made.</h3>\r\n</div>\r\n\r\n</div>\r\n\r\n<hr />'),
