(2769, 533, 'project_stories_3_project_story_content', '<div class="row">\r\n\r\n<div class="col-sm-5">\r\n<h3 class="m3 bold">Members pay directly.</h3>\r\n<h3 class="text m3">When a member is ready to book a rental, they can check out directly through the site. Their saved credit card is charged automatically.</h3>\r\n</div>\r\n\r\n<div class="col-sm-7">\r\n<img src="http://localhost/ws/wp-content/uploads/2015/02/coco-spreads-cart-v1-1024x843.jpg" alt="coco-spreads-cart-v1" width="1024" height="843" class="alignnone size-large wp-image-534 shadow" />\r\n</div>\r\n\r\n</div>'),
