(2789, 97, 'project_stories_1_project_story_content', '<div class="row m90">\r\n<div class="col-sm-2 col-sm-offset-2">\r\n<img src="http://localhost/ws/wp-content/uploads/2015/01/inctechlogo.png" alt="inctechlogo" width="600" height="600" class="alignnone size-full wp-image-557" />\r\n</div>\r\n<div class="col-sm-4 col-sm-offset-1">\r\n<h3>\r\nThe Inctech Olympiad contest helps high school students to find a solution to a problem they\'re currently facing, and submit the results of their exploration for a chance to win scholarship funds. \r\n</h3>\r\n</div>\r\n</div>\r\n\r\n<div class="row">\r\n<div class="col-sm-10 col-sm-offset-1">\r\n<video autoplay="autoplay" loop poster="">\r\n<source src="http://localhost/ws/wp-content/uploads/2015/01/inctech-final.mp4" type="video/mp4" />\r\n<source src="http://localhost/ws/wp-content/uploads/2015/01/inctech-final.webm" type="video/webm" />\r\n</video>\r\n</div>\r\n</div>'),
