(2873, 89, 'project_stories_2_project_story_content', '<div class="row">\r\n\r\n<div class="col-sm-offset-1 col-sm-10">\r\n\r\n<video class="shadow" autoplay="autoplay" loop poster>\r\n\r\n<source src="http://localhost/ws/wp-content/uploads/2015/01/dd-model-screen-record-2.5x-breaked.mp4" type="video/mp4"/>\r\n\r\n</video>\r\n<p class="text italic">\r\nConstructing a 3D model of the Phone Booth helped us to design our construction process while producing CAD drawings and CAM specifications for our Computer Numerically Controlled Router.\r\n</p>\r\n</div>\r\n\r\n</div>'),
