(2885, 89, 'project_stories_3_project_story_content', '<div class="row mt">\r\n\r\n<div class="col-sm-offset-1 col-sm-10">\r\n<style>\r\n.embed-container { position: relative; padding-bottom: 56.25%; height: 0; overflow: hidden; max-width: 100%; } .embed-container iframe, .embed-container object, .embed-container embed { position: absolute; top: 0; left: 0; width: 100%; height: 100%; }\r\niframe {\r\n    volume: silent;\r\n}\r\n</style>\r\n<div class="embed-container shadow">\r\n<iframe src="https://player.vimeo.com/video/108903396" frameborder="0" webkitallowfullscreen mozallowfullscreen allowfullscreen></iframe>\r\n</div>\r\n<p class="text italic">\r\nWe demolished an interior wall constructed the phone booth in the resulting void.\r\n</p>\r\n</div>\r\n\r\n</div>'),
