(2897, 89, 'project_stories_4_project_story_content', '<div class="row mt">\r\n\r\n<div class="col-sm-offset-1 col-sm-5">\r\n<div class="embed-container shadow">\r\n<iframe src="https://player.vimeo.com/video/109489659" frameborder="0" webkitallowfullscreen mozallowfullscreen allowfullscreen></iframe>\r\n</div>\r\n<p class="text italic">A soft-close sliding separates the booth from its environment.</p>\r\n</div>\r\n\r\n<div class="col-sm-5">\r\n<div class="embed-container shadow">\r\n<iframe src="https://player.vimeo.com/video/109489657" frameborder="0" webkitallowfullscreen mozallowfullscreen allowfullscreen></iframe>\r\n\r\n</div>\r\n<p class="text italic">An occupancy sensor illuminates the dialog-box icon when the booth is in use.</p>\r\n</div>\r\n\r\n</div>\r\n\r\n\r\n<div class="row mt">\r\n\r\n<div class="col-sm-offset-1 col-sm-5">\r\n<div class="embed-container shadow">\r\n<iframe src="https://player.vimeo.com/video/109489658" frameborder="0" webkitallowfullscreen mozallowfullscreen allowfullscreen></iframe>\r\n</div>\r\n<p class="text italic">The booth\'s interior sports a fold-down table, stand alone power, and its own lighting.</p>\r\n</div>\r\n\r\n</div>\r\n'),
