(121, 1, '2015-01-21 16:19:54', '2015-01-21 16:19:54', '<div class="row">\r\n\r\n<div class="col-sm-10 col-sm-offset-1">\r\n\r\n<h2 class="brand m3">Applications are now closed. Thanks to everyone who applied – you\'ll be hearing from us soon!</h2>	\r\n	\r\n<h3>Last year’s summer apprenticeship program was a blast. Alongside three fantastic apprentices, we worked on 14 different projects, spanning branding, web design, furniture design, architectural design, and public art. <br class="hidden-sm hidden-xs" /> The five of us learned so much together – <br class="hidden-sm hidden-xs" /> and this year we’re doing it again.</h3>\r\n\r\n<h2 class="brand dash-before section-break">The Apprenticeship Program</h2>\r\nWork-Shop is super excited to offer an immersive apprenticeship program for the Summer of 2015. Students and recent graduates of Rhode Island colleges will join our team and participate in a variety of research, design, and production projects. In addition to this, apprentices will propose their own, to be completed over the course of the apprenticeship with our resources, guidance, and collaboration.\r\n\r\nApprentices will exercise their skills and gain hands-on experience, as well as expand the knowledge and working practices through focused design, making, and interdisciplinary collaboration.\r\n\r\nCandidates should be currently enrolled at a college in Rhode Island, or be graduating this spring. We are seeking 2-5 apprentices and will look to formulate a diverse team with complementary and supplementary skillsets.\r\n\r\nThe position will either be full-time or part-time – based on our needs and each apprentice’s availability. The majority of the work will take place at our office in Providence and our fabrication shop in Olneyville, so living near or in Providence during the summer is a must.\r\n\r\nThese are paid positions, wage commensurate with experience. The  timeline is June 8th - August 24th, with some flexibility.\r\n	\r\n<h2 class="brand section-break">What you might work on</h2>\r\n<ul class="list">\r\n	<li>Product and furniture design and fabrication</li>\r\n	<li>Architectural design</li>\r\n	<li>Installation design and fabrication <span class="brand">*</span></li>\r\n	<li>Physical computing</li>\r\n	<li>Branding, identity, and visual design</li>\r\n	<li>Web, UI/UX design and development</li>\r\n	<li>Software development</li>\r\n	<li>Business development and strategy</li>\r\n	<li>Digital fabrication research</li>\r\n	<li>Social programming such as workshops and events</li>\r\n</ul>\r\n\r\n<span class="brand">*</span>We have received a substantial grant to build 2 \'Urban Chapels\' in Providence this year. Apprentices interested in this project will have a chance to contribute heavily to these outdoor public art project\'s design, fabrication, and installation. \r\n\r\n<h2 class="brand section-break">Responsibilities</h2>\r\n<ul class="list">\r\n	<li>Contribute to the design and execution of client and research projects</li>\r\n	<li>Create models, drawings, and prototypes of ongoing work</li>\r\n	<li>Assist with on-site construction and installation projects</li>\r\n	<li>Research and develop a personal project</li>	\r\n	<li>Never get us coffees, unless you want to</li>\r\n</ul>\r\n\r\n<h2 class="brand section-break">Requirements + Eligibility</h2>\r\n<ul class="list">\r\n	<li>Currently enrolled at, or about to graduate from a Rhode Island institution of higher learning</li>\r\n	<li>Living in or near Providence, Rhode Island for the summer</li>\r\n	<li>Interested in design across disciplines</li>\r\n	<li>Interested in the intersection of design and making</li>\r\n	<li>Self motivated, independent</li>\r\n	<li>Collaborative</li>\r\n	<li>Reliable and responsible</li>\r\n	<li>Interested in learning and helping others learn</li>\r\n</ul>\r\n\r\n<h2 class="brand section-break">Nice to have:</h2>\r\n<ul class="list">\r\n	<li>3d modeling experience such as rhino or solid works</li>\r\n	<li>Digital fabrication experience</li>\r\n	<li>Scripting / computation / software</li>\r\n	<li>Web development - HTML/CSS/JS</li>\r\n	<li>UI/UX design</li>\r\n	<li>Woodworking / metalworking / fabrication</li>\r\n	<li>Architectural design and representation</li>\r\n	<li>Grant-writing</li>\r\n	<li>Leadership/strategic development</li>\r\n</ul>\r\n\r\n<h2 class="section-break brand">If you are interested in applying, please send:</h2>\r\n<h2 class="brand">statement of intent, resume, and relevant work samples to jobs@workshopri.com</h2>\r\n<h3 class="brand bold">The deadline to apply is April 6th. Final decisions will be made by May 15th.</h3>\r\n\r\n</div>\r\n</div>', '2015 Summer Apprenticeship Program', '', 'publish', 'open', 'open', '', 'apprenticeship', '', '', '2015-04-08 16:35:47', '2015-04-08 16:35:47', '', 0, 'http://localhost/ws/?page_id=121', 0, 'page', '', 0),
