(155, 1, '2015-01-22 18:03:42', '2015-01-22 18:03:42', '\r\n<div class="row m90">\r\n	\r\n	<div class="col-sm-10 col-sm-offset-1">\r\n	\r\n	<h2 class="brand dash-before section-break">Front End Developer</h2>\r\n	\r\n	Work-Shop is seeking a Front End Developer to join our team. We design and build websites, apps, and software at a variety of scales. We need someone who can collaborate with designers and developers to execute kick-ass work. Strong candidates will be have strong principles and be passionate about their work, but agile enough to respond to changing conditions.\r\n	\r\n	\r\n	\r\n	The position is 20-30 hours per week, wage commensurate with experience. The position has the opportunity to become full time.  \r\n	\r\n	<h2 class="brand section-break">Responsibilities</h2>\r\n	<ul class="list">\r\n		<li>Contribute to the technical strategy of projects</li>\r\n		<li>Build front end interfaces from wireframes/mockups</li>\r\n		<li>Collaborate with designers and inform/support their process</li>\r\n		<li>Collaborate with other developers and inform/support their process</li>\r\n		<li>Test and debug your work</li>		\r\n	</ul>\r\n	\r\n	<h2 class="brand section-break">Requirements</h2>\r\n	<ul class="list">\r\n		<li>Strong understanding of current front end development practices</li>\r\n		<li>Understanding of responsive design practices</li>\r\n		<li>Strong sense of craft in development</li>\r\n		<li>Fluent in HTML, CSS, JS</li>	\r\n		<li>Ability to work in a variety of frameworks/libraries</li>\r\n		<li>Self motivated, independent</li>\r\n		<li>Collaborative</li>\r\n		<li>Reliable and responsible</li>\r\n		<li>Interested in learning and helping others learn</li>\r\n	</ul>\r\n	\r\n	<h2 class="brand section-break">Nice to have:</h2>\r\n	<ul class="list">\r\n		<li>Graduate from a college in Rhode Island</li> \r\n		<li>Understanding/experience of back end development practices</li>\r\n		<li>Experience with wordpress</li>	\r\n		<li>Experience with twitter bootstrap</li>	\r\n		<li>Project management skills</li>	\r\n	</ul>\r\n	\r\n	<h2 class="section-break brand">If you are interested in applying, please send:</h2>\r\n	<h2 class="brand">statement of intent, resume, and relevant work samples to jobs@workshopri.com</h2>\r\n	\r\n	</div>\r\n	\r\n</div>\r\n', 'Front End Developer', '', 'inherit', 'open', 'open', '', '132-revision-v1', '', '', '2015-01-22 18:03:42', '2015-01-22 18:03:42', '', 132, 'http://localhost/ws/132-revision-v1/', 0, 'revision', '', 0),
(156, 1, '2015-01-26 14:00:57', '2015-01-26 14:00:57', '<div class="row m90">\n<div class="col-sm-10 col-sm-offset-1">\n<h2 class="brand dash-before section-break">The position</h2>\nWork-Shop is seeking a Front End Developer to join our team. We design and build websites, apps, and software at a variety of scales. We need someone who can collaborate with designers and developers to execute kick-ass work, primarily kick-ass websites. HTML, CSS and Javascript experience is a must.\n\nStrong candidates will have staunch principles and passion for their work, yet will be agile enough to respond to changing conditions.\n\nDevelopers working with us will gain experience at all stages of a project, from requirements gathering, to research, to design, development, deployment, and testing. Developers will have a chance to interact with clients, designers, other developers, and the awesome community of people we work with.\n\nThe Developer will be on-site with us at our offices in downtown Providence, but we can entertain some remote work. We are a very collaborative and hands on group, so a fair amount on-site work is necessary.\n\nThe position is 20-30 hours per week (specific days of the week flexible), wage commensurate with experience. The position has the opportunity to become full time.\n\nWe are looking for someone to start working with us sometime in February.\n<h2 class="brand section-break">Responsibilities</h2>\n<ul class="list">\n	<li>Contribute to the technical strategy of projects, helping to determine what we make and how we make it</li>\n	<li>Build front end interfaces of websites from wireframes/mockups</li>\n	<li>Collaborate with designers and inform/support their process</li>\n	<li>Collaborate with other developers and inform/support their process</li>\n	<li>Test and debug your work</li>\n</ul>\n<h2 class="brand section-break">Requirements</h2>\n<ul class="list">\n	<li>Strong understanding of current front end development practices</li>\n	<li>Understanding of responsive design practices</li>\n	<li>Strong sense of craft in development</li>\n	<li>Fluent in HTML, CSS, JS</li>\n	<li>Ability to work in a variety of frameworks/libraries</li>\n	<li>Self motivated, independent</li>\n	<li>Collaborative</li>\n	<li>Reliable and responsible</li>\n	<li>Interested in learning and helping others learn</li>\n</ul>\n<h2 class="brand section-break">Nice to have:</h2>\n<ul class="list">\n	<li>Graduated from a college in Rhode Island</li>\n	<li>Understanding/experience of back end development practices</li>\n	<li>Experience with wordpress</li>\n	<li>Experience with twitter bootstrap</li>\n	<li>Project management skills</li>\n</ul>\n<h2 class="section-break brand">If you are interested in applying, please send:</h2>\n<h2 class="brand">statement of intent, resume, and relevant work samples to jobs@workshopri.com</h2>\n</div>\n</div>', 'Front End Developer', '', 'inherit', 'open', 'open', '', '132-autosave-v1', '', '', '2015-01-26 14:00:57', '2015-01-26 14:00:57', '', 132, 'http://localhost/ws/132-autosave-v1/', 0, 'revision', '', 0),
