(219, 1, '2015-01-27 19:23:19', '2015-01-27 19:23:19', '<h2 class="brand dash-before section-break">The Position</h2>\nWork-Shop is seeking a Designer/Maker to join our team. We are looking for someone to help us with our material and fabrication-based projects, from conception, to rounds of design iterative design, and through production. <span class="bold brand">We design and make spaces, installations, furniture, and objects, at a variety of scales, and the Associate working with us would be an integral part of that.</span> Strong candidates have conviction in their design sensibility, and confidence in their ability to execute. A strong sense of craft and thoughtful making is a requirement. Associates working with us will gain experience in project management and strategy, while honing their design and making skills through a project-based work. Associates will collaborate with us on all aspects of the project, working with clients, our team, and our community to complete kick-ass projects. The Associate will work with us both in our Downtown Providence offices and our shop space on Providenceâ€™s west side. We are a collaborative group â€“ on-site, in-house work is necessary. The position is 20-30 hours per week (specific days of the week are flexible), wage commensurate with experience. The position has the opportunity to become full time. We are looking for someone to start working with us in February.\n<h2 class="brand section-break">Responsibilities</h2>\n<ul class="list">\n	<li>Contribute to the design of a variety of physical projects.</li>\n	<li>Participate in weekly team meetings</li>\n	<li>- Produce sketches, drawings, and presentations of design ideas, both internally and for clients</li>\n	<li>Produce construction documents and shop drawings of physical projects</li>\n	<li>Contribute to fabrication of projects in our shop, occasionally stepping into management or oversight roles on a project-by-project basis.</li>\n</ul>\n<h2 class="brand section-break">What you might be making</h2>\n<ul class="list">\n	<li>Furniture</li>\n	<li>Public art / sculpture / installations</li>\n	<li>Architectural models</li>\n	<li>Home goods / design objects</li>\n	<li>Cabinetry / carpentry / millwork</li>\n</ul>\n<h2 class="brand section-break">Requirements</h2>\n<ul class="list">\n	<li>Experience designing physical objects and spaces</li>\n	<li>Experience presenting and communicating ideas</li>\n	<li>Experience with hands-on making and fabrication</li>\n	<li>CAD/CAM and Rendering Experience</li>\n	<li>Strong sense of craft in both design and making</li>\n</ul>\n<h2 class="brand section-break">Nice to have:</h2>\n<ul class="list">\n	<li>Digital fabrication experience</li>\n	<li>Experience with the Rhino modeling suite.</li>\n	<li>Design education or training</li>\n	<li>Metalworking experience</li>\n	<li>Construction experience</li>\n	<li>Architectural model-making skills</li>\n	<li>Graduated from a Rhode Island college</li>\n	<li>Home Cook</li>\n</ul>\n<h2 class="section-break brand">If you are interested in applying, please send:</h2>\n<h2 class="brand">statement of intent, resume, and relevant work samples to jobs@workshopri.com</h2>', 'Associate Designer', '', 'inherit', 'open', 'open', '', '128-autosave-v1', '', '', '2015-01-27 19:23:19', '2015-01-27 19:23:19', '', 128, 'http://localhost/ws/128-autosave-v1/', 0, 'revision', '', 0),
(220, 1, '2015-01-27 19:30:10', '2015-01-27 19:30:10', '<div class="row m90">\r\n	\r\n	<div class="col-sm-10 col-sm-offset-1">\r\n	\r\n	<h2 class="brand dash-before section-break">The Position</h2>\r\n	\r\n	Work-Shop is looking for a Production Assistant to join our team. We design and build physical or constructed projects, ranging from custom furniture and interiors to inhabitable, outdoor installations. We need someone to help fabricate, construct, and/or install our physical work. <span class="bold brand">In short, we’re looking for someone comfortable with a modern shop setting, with a strong sense of craft, and with an ability to build kick-ass projects.</span>\r\n\r\nStrong candidates will be knowledgeable about fabrication methods and techniques, and have a sense of when these techniques are appropriate for a project.\r\n\r\nProduction assistants will gain experience working on the fabrication of projects at a variety of scopes and time-scales. Production assistants will be involved in fabrication, quality assurance, delivery to site, and installation of our material projects.\r\n\r\nThe PA will work in our shop space on the west side of Providence. The PA’s hands-on responsibilities to require them to be on-site during scheduled hours.\r\n\r\nThis position is 20-30 hours per week, wage commensurate with experience.\r\n\r\nWe’re looking for someone to start in mid February.\r\n	\r\n	\r\n	\r\n	<h2 class="brand section-break">Responsibilities</h2>\r\n	<ul class="list">\r\n		<li>Collaborate on the development of fabrication strategies for several projects</li>\r\n		<li>Fabricate projects from shop drawings, specifications, and instructions, using both digital and manual tools</li>\r\n		<li>Program and run our CNC Router, with training and guidance</li>\r\n		<li>Maintain order, inventory, and organization in our shop space</li>		\r\n	</ul>\r\n	\r\n	<span class="italic h4">We are currently making a large scale urban model of the city of providence. A majority of the Production Assistant\'s responsibilities will be related to this model.</span> \r\n		\r\n\r\n\r\n<h2 class="brand section-break">What you might be making</h2>\r\n	<ul class="list">\r\n		<li>Furniture</li>\r\n		<li>Public art / sculpture / installations</li>\r\n		<li>Architectural models</li>	\r\n		<li>Home goods / design objects</li>\r\n		<li>Cabinetry / carpentry / millwork</li>\r\n	</ul>\r\n\r\n\r\n\r\n	<h2 class="brand section-break">Requirements</h2>\r\n	<ul class="list">\r\n		<li>Safety-first mentality</li>\r\n		<li>Experience in a wood shop or other fabrication environment</li>\r\n		<li>Strong woodworking skills</li>\r\n		<li>Strong sense of craft in fabrication and construction</li>	\r\n		<li>Self motivated and independent</li>\r\n	</ul>\r\n\r\n\r\n	\r\n	<h2 class="brand section-break">Nice to have:</h2>\r\n	<ul class="list">\r\n		<li>Familiarity in CAD and/or CAM environments, especially Rhino</li> \r\n		<li>Digital fabrication experience</li>\r\n		<li>Design education or training</li>\r\n	        <li>Metalworking experience</li>\r\n                <li>Construction experience</li>\r\n		<li>Architectural model-making skills</li>	\r\n		<li>Graduated from a Rhode Island college</li>\r\n                <li>Home Cook</li>			\r\n	</ul>\r\n	\r\n	<h2 class="section-break brand">If you are interested in applying, please send:</h2>\r\n	<h2 class="brand">statement of intent, resume, and relevant work samples to jobs@workshopri.com</h2>\r\n	\r\n	</div>\r\n	\r\n</div>', 'Fabrication and Production Assistant', '', 'inherit', 'open', 'open', '', '130-revision-v1', '', '', '2015-01-27 19:30:10', '2015-01-27 19:30:10', '', 130, 'http://localhost/ws/130-revision-v1/', 0, 'revision', '', 0),
(221, 1, '2015-01-27 19:31:34', '2015-01-27 19:31:34', '<div class="row m90">\r\n	\r\n	<div class="col-sm-10 col-sm-offset-1">\r\n	\r\n	<h2 class="brand dash-before section-break">The Position</h2>\r\n	\r\n	Work-Shop is seeking a Designer/Maker to join our team. We’re looking for someone to help us with our material and fabrication-based projects, from conception, to rounds of design iterative design, and through production. <span class="bold brand">We design and make spaces, installations, furniture, and objects, at a variety of scales, and the Associate working with us would be an integral part of that.</span>\r\n\r\nStrong candidates have conviction in their design sensibility, and confidence in their ability to execute. A strong sense of craft and thoughtful making is a requirement.\r\n\r\nAssociates working with us will gain experience in project management and strategy, while honing their design and making skills through a project-based work. Associates will collaborate with us on all aspects of the project, working with clients, our team, and our community to complete kick-ass projects.\r\n\r\nThe Associate will work with us both in our Downtown Providence offices and our shop space on Providence’s west side. We’re a collaborative group – on-site, in-house work is necessary.\r\n\r\nThe position is 20-30 hours per week (specific days of the week are flexible), wage commensurate with experience. The position has the opportunity to become full time.\r\n\r\nWe’re looking for someone to start working with us in February.\r\n	\r\n	\r\n	\r\n	<h2 class="brand section-break">Responsibilities</h2>\r\n	<ul class="list">\r\n		<li>Contribute to the design of a variety of physical projects.</li>\r\n		<li>Participate in weekly team meetings</li>\r\n		<li>- Produce sketches, drawings, and presentations of design ideas, both internally and for clients</li>\r\n		<li>Produce construction documents and shop drawings of physical projects</li>	\r\n                <li>Contribute to fabrication of projects in our shop, occasionally stepping into management or oversight roles on a project-by-project basis.</li>	\r\n	</ul>\r\n	\r\n	\r\n<h2 class="brand section-break">What you might be making</h2>\r\n	<ul class="list">\r\n		<li>Furniture</li>\r\n		<li>Public art / sculpture / installations</li>\r\n		<li>Architectural models</li>	\r\n		<li>Home goods / design objects</li>\r\n		<li>Cabinetry / carpentry / millwork</li>\r\n	</ul>\r\n\r\n\r\n\r\n	<h2 class="brand section-break">Requirements</h2>\r\n	<ul class="list">\r\n		<li>Experience designing physical objects and spaces</li>\r\n		<li>Experience presenting and communicating ideas</li>\r\n		<li>Experience with hands-on making and fabrication</li>\r\n		<li>CAD/CAM and Rendering Experience</li>	\r\n		<li>Strong sense of craft in both design and making</li>\r\n	</ul>\r\n\r\n\r\n	\r\n	<h2 class="brand section-break">Nice to have:</h2>\r\n	<ul class="list">\r\n		<li>Digital fabrication experience</li> \r\n		<li>Experience with the Rhino modeling suite.</li>\r\n		<li>Design education or training</li>\r\n	        <li>Metalworking experience</li>\r\n                <li>Construction experience</li>\r\n		<li>Architectural model-making skills</li>	\r\n		<li>Graduated from a Rhode Island college</li>\r\n                <li>Home Cook</li>		\r\n	</ul>\r\n	\r\n	<h2 class="section-break brand">If you are interested in applying, please send:</h2>\r\n	<h2 class="brand">statement of intent, resume, and relevant work samples to jobs@workshopri.com</h2>\r\n	\r\n	</div>\r\n	\r\n</div>', 'Associate Designer/Maker', '', 'inherit', 'open', 'open', '', '128-revision-v1', '', '', '2015-01-27 19:31:34', '2015-01-27 19:31:34', '', 128, 'http://localhost/ws/128-revision-v1/', 0, 'revision', '', 0),
