(454, 1, '2015-02-03 18:33:14', '2015-02-03 18:33:14', '<div class="row m60">\r\n	<div class="col-sm-10 col-sm-offset-1">\r\n		<h3 class="m3">\r\n			This is a demonstration of two complete run-throughs of the Visual Attention Span Test App – developed for the <a class="bold dark" href="http://labvislearn.org">Laboratory for Visual Learning</a>.\r\n		</h3> \r\n		<h4>  \r\n			The videos show a user loading a test file, clicking through the test, and returning to the start screen. The first video shows normal test execution, while the second shows a mid-test exit condition.\r\n		</h4>\r\n	</div>\r\n</div>\r\n\r\n<div class="row m60 padded bg-white shadow">\r\n	<div class="col-sm-4 col-sm-offset-1">\r\n		<video class="padded" autoplay loop poster mute>\r\n			<source src="http://localhost/ws/wp-content/uploads/2015/02/app-recording-1-usage-render-breaked.mp4" type="video/mp4" />\r\n		</video>\r\n		<h6 class="italic" >Normal Test.</h6>\r\n	</div>\r\n	<div class="col-sm-4 col-sm-offset-2">\r\n		<video class="padded" autoplay loop poster mute>\r\n			<source src="http://localhost/ws/wp-content/uploads/2015/02/app-recording-2-exit-render-breaked.mp4" type="video/mp4" />\r\n		</video>\r\n		<h6 class="italic" >Mid-Test Exit.</h6>\r\n	</div>\r\n</div>\r\n\r\n<div class="row">\r\n	<div class="col-sm-5 col-sm-offset-1">\r\n		<h3 class="m30 dark">\r\n			Usage\r\n		</h3>\r\n		<h4>\r\n		<span class="bold dark">The requisite test files and test assets are uploaded to the app via the iTunes file manager.</span> The app parses available test files, and runs tests for users, optionally sending an email notification on test completion. This is a version 1 product meant for researcher evaluation.\r\n		</h4>\r\n	</div>\r\n	<div class="col-sm-5 col-sm-offset-1">\r\n		<h3 class="m30 dark">\r\n			Goals\r\n		</h3>\r\n				<h4>The app is used to test Visual Attention Span, by displaying a series of user-uploaded test cards to the testee.</h4>\r\n		<h4>More generally, the app displays time- and touch-based sequences of slides, for various visual evaluation purposes.</h4>\r\n		<h4>This app is intended as a research tool for a specific user-base with access to special test files and training on how to use them.</h4>\r\n\r\n\r\n	</div>\r\n</div>', 'VASpan App Demo Video', '', 'publish', 'open', 'open', '', 'vaspan-app', '', '', '2015-02-03 21:00:40', '2015-02-03 21:00:40', '', 0, 'http://localhost/ws/?page_id=454', 0, 'page', '', 0),
