(506, 1, '2015-02-12 16:54:47', '2015-02-12 16:54:47', '<div class="row m2">\r\n	<div class="col-sm-12 centered">\r\n		<h4 class="bold uppercase">Saturday, Feb 28th, 2:00pm</h4>\r\n		<h4 class="bold uppercase">Yale, CEID Lecture Hall, 15 Prospect Street, New Haven CT</h4>\r\n		<h4>Sponsored by <a href="http://www.cameronyick.us/ymakes/" title="" target="_blank">YaleMakes</a> and <a href="http://ceid.yale.edu" title="" target="_blank">Yale Center for Engineering Innovation and Design</a></h4>\r\n	</div>\r\n	</div>\r\n<div class="row m2">\r\n	<div class="col-sm-12">\r\n		<h2>As the first post-millennial generation begins to enter the workforce, new approaches to work are entering with them. How are these new cultures affecting the collective experience of the contemporary work-place? How do we design material and personal ecosystems to address these new ways of working? Join Work-Shop, an interdisciplinary design studio, as they explore these questions through large-scale discussion and small-scale architecture.\r\n		</h2>\r\n	</div>\r\n</div>\r\n\r\n<div class="row m3">\r\n		<div class="col-sm-12">\r\n			<h4>Photos from past workshops:</h4>\r\n			</div>\r\n		<div class="col-sm-6 col-xs-6 m1">\r\n		<img src="http://localhost/ws/wp-content/uploads/2015/02/MG_0025-1024x683.jpg" alt="_MG_0025" width="1024" height="683" class="alignnone size-large wp-image-523" />\r\n			</div>\r\n<div class="col-sm-6 col-xs-6 m1">\r\n<img src="http://localhost/ws/wp-content/uploads/2015/02/MG_0027-1024x683.jpg" alt="_MG_0027" width="1024" height="683" class="alignnone size-large wp-image-524" />\r\n</div>\r\n		<div class="col-sm-6 col-xs-6 m1">\r\n<img src="http://localhost/ws/wp-content/uploads/2015/02/MG_0037-1024x683.jpg" alt="_MG_0037" width="1024" height="683" class="alignnone size-large wp-image-525" />\r\n</div>\r\n		<div class="col-sm-6 col-xs-6 m1">\r\n<img src="http://localhost/ws/wp-content/uploads/2015/02/MG_0060-1024x683.jpg" alt="_MG_0060" width="1024" height="683" class="alignnone size-large wp-image-526" />\r\n		</div>\r\n	</div>\r\n\r\n<div class="row m2">\r\n		<div class="col-sm-12">\r\n			<h2 class="centered">See you there!</h2>\r\n			</div>\r\n	</div>\r\n', 'Contemporary Work-Spaces and Work-Places, a short lecture and workshop', '', 'publish', 'open', 'open', '', 'yalemakes', '', '', '2015-02-18 14:36:46', '2015-02-18 14:36:46', '', 0, 'http://localhost/ws/?page_id=506', 0, 'page', '', 0),
