n	<li>Woodworking / metalworking / fabrication</li>\r\n	<li>Architectural design and representation</li>\r\n	<li>Grant-writing</li>\r\n	<li>Leadership/strategic development</li>\r\n</ul>\r\n\r\n<h2 class="section-break brand">If you are interested in applying, please send:</h2>\r\n<h2 class="brand">statement of intent, resume, and relevant work samples to jobs@workshopri.com</h2>\r\n<h2 class="brand bold">The deadline to apply is April 6th. Final decisions will be made by May 15th.</h2>\r\n\r\n</div>\r\n</div>', '2015 Summer Apprenticeship Program', '', 'inherit', 'open', 'open', '', '121-revision-v1', '', '', '2015-03-12 23:38:19', '2015-03-12 23:38:19', '', 121, 'http://localhost/ws/121-revision-v1/', 0, 'revision', '', 0),
