INSERT INTO `wp_rg_lead_detail_long` ( `lead_detail_id`, `value`) VALUES
(56, 'Hi,\r\nKnowing that I am looking to move to Providence, a friend of mine at RISD sent me your url.  Fun stuff you do,  Me: old school AI, visual languages, optimization, pattern recognition, commercial planning and scheduling products and patents, plus about 10 yrs building homes and cabinetmaking. No talent for user interfaces, so might could collaborate on something.  In Providence on 2/23 morning.'),
(67, 'Hello, \r\n\r\nI am curious to know if you have ever worked on a mobile/traveling event display? We are currently obtaining quotes/timelines from production teams for the creation of two mobile units - both of which have been previously designed and thought out. \r\n\r\nLet me know if this is something that you might be interested in. \r\n\r\nThank you in advance!\r\n\r\nBest, \r\nSara'),
(85, 'Hi! I see that you guys are hiring a production assistant, looking to start in February.  Although I am still a Rhode Island resident, I am in Tucson, Arizona until late Spring.  I had the chance to skip a northeast winter, and I guess I picked the right one! I was just wondering If ya\'ll were planning on taking on any new employees this summer. I have been working in Providence\'s restaurant scene for the last 4 or 5 years, but I would love to transition into a different but still creative industry. I would be happy to send along a resume, just wanted to get on the radar first. Thanks for your time. \r\n-John'),
(91, 'Hey Work Shop RI folks! A friend just showed me your website and I feel like we\'d have stuff to talk about! My training is in urban planning, and I love making beautiful maps and websites. I also get really excited about how cities work and making them work better. I moved to Providence last summer and have loved getting involved. Let me know if you\'d like to get coffee!'),
(94, 'Dear officer,\r\n\r\nMy name is Xin and I am a grad student in RISD now. For my thesis project, I am going to build a device which the audience will wear on their head. The functionality is basically decided but I am not familiar with product design, especially the shape and manufacturing process. I am wondering whether your studio would take individual projects like this and how the quote will be. FYI, the deadline of the final product will be early May. \r\n\r\nPlease feel free to contact and ask more about the details.\r\n\r\nAll best, \r\n\r\nXin'),
(102, 'Hi Greg and Nic, \r\n\r\nMy name is Dashell Laryea. I am a graduating senior at Yale and attended your Contemporary Work-Spaces workshop at the CEID. I just wanted to send a quick note saying, "thanks!" I really enjoyed the workshop, I am a fan of your holistic design practice,  and I hope to implement some of your thoughts at IDEO post-graduation.\r\n\r\nI hope to bump into you guys in the future.\r\n\r\nDash'),
(105, 'Hello,\r\n\r\nMy name is Allisan Salazar I\'m a graphic design senior at RISD. I am looking to outsource a project for an exhibition I am creating for my senior thesis. One of my plans for the show is to create a life size installation/ sculpture/ furniture piece that I was hoping your workshop could help me with. I would love to discuss further at any time convenient for you. My phone number is 9084471877 but e-mail also works great. \r\n\r\nThank you! \r\nBest,\r\nAllisan Salazar'),
(128, 'I tried to sign up for a coffee spot next Thursday but it didn\'t seem to submit. I just wanted to make sure it went through. If it didn\'t, let me know and I\'ll try to send it through again.\r\n\r\nThanks!\r\nArjun') ;
